Ajustați modul în care se afișează culorile pe dispozitiv. Acest lucru poate fi util când doriți să:<br/><br/> <ol> 
&nbsp;vedeți culorile mai bine; 
&nbsp; eliminați culorile pentru a vă ajuta să vă concentrați. </ol>

"Dispozitivul s-a supraîncălzit. Pentru a se evita deteriorarea, acesta s-a oprit.

Supraîncălzirea poate fi cauzată de:
- Utilizarea îndelungată a aplicațiilor cu un nivel intens de grafică, de exemplu, jocuri și aplicații de navigare;
-Transferul fișierelor mari;
- Utilizarea dispozitivului într-un mediu cu temperatură ridicată."

"Telefonul se încălzise prea mult și s-a oprit pentru a se răci. Acum telefonul funcționează normal.

Telefonul s-ar putea încălzi prea mult dacă:
\u0009• folosiți aplicații care consumă multe resurse (de ex., jocuri, aplicații video/de navigare);
\u0009• descărcați/încărcați fișiere mari;
\u0009• folosiți telefonul la temperaturi ridicate."
